import React from "react";
import styled from "styled-components";
import { useHistory } from "react-router-dom";

export const Gender = () => {
  const history = useHistory();
  return (
    <StyledWrapper>
      <div className="container-fluid">
        <div className="row gender">
          <h2>Choose your sex</h2>
        </div>
        <div className="row buttons">
          <div className="col">
            <button type="button" onClick={() => history.push("./FatLoss")}>
              Women
            </button>
          </div>
          <div className="col">
            <button type="button" onClick={() => history.push("./FatLoss")}>
              Men
            </button>
          </div>
        </div>
      </div>
    </StyledWrapper>
  );
};

const StyledWrapper = styled.div`
  .container-fluid {
    background-color: #1a273e;
    height: 40vh;
  }
  .gender {
    color: white;
  }
  .buttons {
    padding-left: 25%;
    padding-top: 30px;
  }
  h2 {
      padding-top: 30px
    text-align: center;
  }
`;
